        <style>
            /* Inicialmente, o menu fica fora da tela */
            #menu {
                position: fixed;  /* Fixa o menu na tela */
                bottom: -100%;    /* Inicialmente, está fora da tela (embaixo) */
                transition: bottom 0.5s ease-in-out;  /* Transição suave para o menu aparecer */
            }
        </style>

        <script>
            const menu = document.getElementById('menu');

            const toggle = () => {
                // Alterna o menu entre visível e fora da tela
                if (menu.style.bottom === '0px') {
                    menu.style.bottom = '-100%';  // Faz o menu desaparecer
                } else {
                    menu.style.bottom = '0px';   // Faz o menu aparecer
                }
            }

            const menuButton = document.getElementById('menuButton');
            const closeButton = document.getElementById('x-button');
            
            menuButton.addEventListener('click', toggle);
            closeButton.addEventListener('click', toggle);
        </script>

		<script type="module">
            import * as THREE from 'three';
            import { GUI } from 'three/addons/libs/lil-gui.module.min.js';
			import { MapControls } from 'three/addons/controls/MapControls.js';
            import { OrbitControls } from 'three/addons/controls/OrbitControls.js';
            import { FontLoader } from 'three/addons/loaders/FontLoader.js';
            import { TextGeometry } from 'three/addons/geometries/TextGeometry.js';

            // Scene and Camera Setup
            const scene = new THREE.Scene();
            // const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);

            const camera = new THREE.PerspectiveCamera( 45, window.innerWidth / window.innerHeight, 1, 500 );
            camera.position.set( 150, 0, 0 );
            camera.lookAt( 0, 0, -200 );

            const renderer = new THREE.WebGLRenderer();
            renderer.antialias = true;
            renderer.setSize(window.innerWidth, window.innerHeight);
            document.body.appendChild(renderer.domElement);

            scene.background = new THREE.Color().setHex( 0xb6d6eb );

            // Room (walls and floor)
            const roomMaterial = new THREE.MeshStandardMaterial({ color: 0xf5f5dc, side: THREE.BackSide });
            const roomGeometry = new THREE.BoxGeometry(10, 6, 10);
            const room = new THREE.Mesh(roomGeometry, roomMaterial);
            scene.add(room);

            // Desk
            const deskMaterial = new THREE.MeshStandardMaterial({ color: 0x8B4513 });
            const deskGeometry = new THREE.BoxGeometry(4, 0.3, 2);
            const desk = new THREE.Mesh(deskGeometry, deskMaterial);
            desk.position.set(0, -2.5, -2);
            scene.add(desk);

            let lightsAroundMonitor = [];
            const monitorLightBase = new THREE.PointLight(
                0x800080, // Cor roxa
                70, // intensidade
                10, // distancia
                3.3 // decaimento
            );

            for (let x = -1.6; x <= 1.6; x += 0.4) {
                // Luz roxa saindo ao redor do monitor
                let monitorLight = monitorLightBase.clone();
                monitorLight.position.set(x, -0.4, -1.5);
                scene.add(monitorLight);
            
                // Adicionar um helper para visualizar a posição da luz (opcional para depuração)
                let lightHelper = new THREE.PointLightHelper(monitorLight, 0.2);
                // scene.add(lightHelper);

                lightsAroundMonitor.push([
                    monitorLight,
                    lightHelper
                ])
            }

            for (let y = -2; y <= -0.5; y += 0.3) {
                // Luz roxa saindo ao redor do monitor
                let monitorLight1 = monitorLightBase.clone();
                let monitorLight2 = monitorLightBase.clone();

                monitorLight1.position.set(-1.7, y, -1.5);
                scene.add(monitorLight1);

                monitorLight2.position.set(1.7, y, -1.5);
                scene.add(monitorLight2);
            
                // Adicionar um helper para visualizar a posição da luz (opcional para depuração)
                let lightHelper1 = new THREE.PointLightHelper(monitorLight1, 0.2);
                // scene.add(lightHelper1);

                let lightHelper2 = new THREE.PointLightHelper(monitorLight2, 0.2);
                // scene.add(lightHelper2);

                lightsAroundMonitor.push([
                    monitorLight1,
                    lightHelper1
                ],
                [
                    monitorLight2,
                    lightHelper2
                ])
            }

            chairSeat.position.set(0, -2.5, 1.5);
            
            const chairBackGeometry = new THREE.BoxGeometry(1, 1, 0.2);
            const chairBack = new THREE.Mesh(chairBackGeometry, chairMaterial);
            chairBack.position.set(0, -1.8, 1.9);

            scene.add(chairSeat);
            scene.add(chairBack);

            // Lighting
            const ambientLight = new THREE.AmbientLight(0xffffff, 0.7);
            scene.add(ambientLight);

            let lampLight = new THREE.PointLight(0xffffff, 50);

            const lampLightHelper = new THREE.PointLightHelper(lampLight, 0.2);
            scene.add(lampLightHelper);

            // Criando o cilindro para simular a corda
            const cordMaterial = new THREE.MeshStandardMaterial({ color: 0x888888 }); // Cor cinza para a corda
            const cordGeometry = new THREE.CylinderGeometry(0.05, 0.05, 0.5, 32); // Fina e longa
            const cord = new THREE.Mesh(cordGeometry, cordMaterial);
            cord.position.set(0, 2.75, 0); // Centralizado abaixo da luz
            scene.add(cord);

            // Criando a esfera para simular a lâmpada
            // apagado: #D3D2D8
            // aceso:   #FEFAD0
            const bulbMaterial = new THREE.MeshStandardMaterial({ color: 0xFEFAD0, emissive: 0xFEFAD0 }); // Amarelo emissivo
            const bulbGeometry = new THREE.SphereGeometry(0.3, 32, 32); // Pequenina para simular uma lâmpada
            const bulb = new THREE.Mesh(bulbGeometry, bulbMaterial);
            bulb.position.set(0, 2.5, 0); // Na base da corda
            scene.add(bulb);

            // Ajustar a posição da luz para coincidir com a lâmpada
            lampLight.position.set(0, 0, 0); // Na mesma posição da lâmpada
            bulb.add(lampLight); // Adicionar a luz à lâmpada para que ela se mova junto

            // ============= CAIXA DE SOM =============
            // Criando a estrutura principal da caixa de som (um paralelepípedo)
            const boxMaterial = new THREE.MeshStandardMaterial({ color: 0x333333 }); // Cor cinza escuro
            const boxGeometry = new THREE.BoxGeometry(1, 2, 0.5); // Dimensões da caixa
            const box = new THREE.Mesh(boxGeometry, boxMaterial);
            box.position.set(-3.1, -2, -2); // Posicionar a caixa de som
            box.rotation.y -= 100;
            scene.add(box);

            // Criando o alto-falante principal (um círculo)
            const speakerMaterial = new THREE.MeshStandardMaterial({ color: 0x000000 }); // Preto para o alto-falante
            const speakerGeometry = new THREE.CircleGeometry(0.4, 32); // Diâmetro e suavidade
            const speaker = new THREE.Mesh(speakerGeometry, speakerMaterial);
            speaker.position.set(0, 0.4, 0.26); // Posicionar na frente da caixa
            box.add(speaker);

            // Criando um segundo alto-falante menor (opcional)
            const smallSpeakerGeometry = new THREE.CircleGeometry(0.2, 32); // Menor diâmetro
            const smallSpeaker = new THREE.Mesh(smallSpeakerGeometry, speakerMaterial);
            smallSpeaker.position.set(0, -0.6, 0.26); // Abaixo do alto-falante principal
            box.add(smallSpeaker);

            // Criando a grade da caixa de som (um plano com textura)
            const gridMaterial = new THREE.MeshStandardMaterial({
                color: 0x444444,
                wireframe: true, // Simula uma grade
            });
            const gridGeometry = new THREE.PlaneGeometry(0.9, 1.9); // Ligeiramente menor que a caixa
            const grid = new THREE.Mesh(gridGeometry, gridMaterial);
            grid.position.set(0, 0, 0.27); // Frontal da caixa
            box.add(grid);

            // Opcional: Adicionar detalhes como botões ou logotipo
            const buttonMaterial = new THREE.MeshStandardMaterial({ color: 0xaaaaaa });
            const buttonGeometry = new THREE.CylinderGeometry(0.05, 0.05, 0.02, 32);
            const button = new THREE.Mesh(buttonGeometry, buttonMaterial);
            button.position.set(0.4, -0.9, 0.26); // No canto inferior direito
            box.add(button);
            // ============= CAIXA DE SOM =============

            // ============= AR CONDICIONADO =============
            // Criando a estrutura principal do ar-condicionado
            const acBodyMaterial = new THREE.MeshStandardMaterial({ color: 0xeeeeee }); // Cor branca
            const acBodyGeometry = new THREE.BoxGeometry(3, 1, 1); // Corpo retangular do AC
            const acBody = new THREE.Mesh(acBodyGeometry, acBodyMaterial);
            acBody.position.set(2.2, 2, -4.5); // Ajuste a posição
            scene.add(acBody);

            // Criando a grade do ar-condicionado
            const gridMaterial2 = new THREE.MeshStandardMaterial({ color: 0x333333 });
            const gridGeometry2 = new THREE.PlaneGeometry(2.5, 0.5); // Plano para simular a grade
            const grid2 = new THREE.Mesh(gridGeometry2, gridMaterial2);
            grid2.position.set(0, -0.25, 0.51); // Frontal, um pouco acima do centro
            acBody.add(grid2);

            // Criando o visor
            const screenMaterial = new THREE.MeshStandardMaterial({ color: 0x0000ff, emissive: 0x0000ff }); // Azul emissivo
            const screenGeometry = new THREE.PlaneGeometry(0.8, 0.3);
            const screen = new THREE.Mesh(screenGeometry, screenMaterial);
            screen.position.set(0.5, 0.3, 0.51); // Superior direito
            acBody.add(screen);

            // Adicionando a temperatura como texto no visor
            const loader = new FontLoader();
            loader.load('https://threejs.org/examples/fonts/helvetiker_regular.typeface.json', (font) => {
                const tempText = '24°C'; // Texto inicial
                const textGeometry = new TextGeometry(tempText, {
                    font: font,
                    size: 0.23,
                    depth: 0.01,
                });
                const textMaterial = new THREE.MeshStandardMaterial({ color: 0xffffff }); // Cor do texto
                const temperatureText = new THREE.Mesh(textGeometry, textMaterial);
                temperatureText.position.set(0.1, 0.2, 0.52); // Ajuste a posição do texto no visor
                acBody.add(temperatureText);

                // Atualização da temperatura
                let currentTemperature = 24; // Temperatura inicial
                setInterval(() => {
                    currentTemperature = Math.floor(Math.random() * 11) + 20; // Temperatura aleatória entre 20 e 30
                    temperatureText.geometry.dispose(); // Remove a geometria antiga
                    temperatureText.geometry = new TextGeometry(`${currentTemperature}°C`, {
                        font: font,
                        size: 0.23,
                        depth: 0.01,
                    });
                }, 3000); // Atualiza a temperatura a cada 3 segundos
            });
            // ============= AR CONDICIONADO =============

            // ============= AUDIO =============
            // create an AudioListener and add it to the camera
            const listener = new THREE.AudioListener();
            camera.add( listener );

            // create a global audio source
            const sound = new THREE.Audio( listener );

            // load a sound and set it as the Audio object's buffer
            const audioLoader = new THREE.AudioLoader();
            audioLoader.load( 'public/music/lofi.mp3', function( buffer ) {
                sound.setBuffer( buffer );
                sound.setLoop( true );
                sound.setVolume( 0.5 );
                sound.play();
            });

            // Camera Position
            camera.position.set(0, 0, 10);

            const controls = new OrbitControls( camera, renderer.domElement );
            controls.update();

            // Raycaster para detectar cliques
            const raycaster = new THREE.Raycaster();
            const mouse = new THREE.Vector2();

            // Função para lidar com o clique
            function onMouseClick(event) {
                // Converte as coordenadas do mouse para o intervalo [-1, 1]
                mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
                mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

                // Atualiza o raycaster com a posição do mouse
                raycaster.setFromCamera(mouse, camera);
                const intersects = {
                    'ar-condicionado': raycaster.intersectObject(acBody),
                    'caixa-de-som':    raycaster.intersectObject(box),
                    'lampada':         raycaster.intersectObject(bulb),
                    'televisao':       raycaster.intersectObject(monitor),
                }

                let objetoMaisPerto = null;

                for (let key in intersects) {
                    if (
                        (intersects[key].length > 0 && !objetoMaisPerto) ||
                        (intersects[key].length > 0 && intersects[objetoMaisPerto][0]['distance'] > intersects[key][0]['distance'])
                    ) {
                        objetoMaisPerto = key;
                    }
                }

                if (objetoMaisPerto) {
                    alert('objeto mais perto: ' + objetoMaisPerto)
                }
            }

            // Animation Loop
            function animate() {
                requestAnimationFrame(animate);
                renderer.render(scene, camera);
            }

            window.addEventListener('click', onMouseClick, false);

            animate();

            // Resize Event Listener
            window.addEventListener('resize', () => {
                camera.aspect = window.innerWidth / window.innerHeight;
                camera.updateProjectionMatrix();
                renderer.setSize(window.innerWidth, window.innerHeight);
            });
        </script>
	</body>
</html>
